import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Learning from './containers/Learning';
import Statics from './containers/Statics';
import Versus from './containers/Versus';
import Logreg from './containers/Logreg';
import * as serviceWorker from './serviceWorker';

class Layout extends React.Component {
    state = {
        //activeMenu: "Learning",
        activeMenu: "Logreg",
    }
    renderSection = () => {
        switch (this.state.activeMenu) {
            case "Logreg":
                return <Logreg/>
            case "Learning":
                return <Learning/>
            case "Statics":
                return <Statics/>
            case "Versus":
                return <Versus/>
            default:
                return <div></div>;
        }
    }
    changeSection = (newSection) => {
        this.setState({activeMenu: newSection});
    }
   
}
ReactDOM.render(<Layout />, document.getElementById('react-section'));

serviceWorker.unregister();
